package troll

import (
	"encoding/base64"
	"strconv"

	"github.com/caddyserver/caddy/v2"
	"github.com/caddyserver/caddy/v2/caddyconfig/caddyfile"
	"github.com/caddyserver/caddy/v2/caddyconfig/httpcaddyfile"
	"github.com/caddyserver/caddy/v2/modules/caddyhttp"
	"go.uber.org/zap"
)

var (
	_ caddy.Provisioner           = (*Troll)(nil)
	_ caddy.Validator             = (*Troll)(nil)
	_ caddyfile.Unmarshaler       = (*Troll)(nil)
	_ caddyhttp.MiddlewareHandler = (*Troll)(nil)
)

func init() {
	caddy.RegisterModule(Troll{})
	httpcaddyfile.RegisterHandlerDirective("troll", parseCaddyfile)
}

type Troll struct {
	// options
	DisableRedirects          bool `json:"disable_redirects"`
	DisableGzips              bool `json:"disable_gzips"`
	DisableXmls               bool `json:"disable_xmls"`
	DisableRandomServerHeader bool `json:"disable_random_server_header"`

	// globals
	gzipBomb      []byte
	billionLaughs []byte
	log           *zap.Logger
}

func (Troll) CaddyModule() caddy.ModuleInfo {
	return caddy.ModuleInfo{
		ID:  "http.handlers.troll",
		New: func() caddy.Module { return new(Troll) },
	}
}

func (b *Troll) UnmarshalCaddyfile(d *caddyfile.Dispenser) error {
	d.NextArg() // skip block beginning: "troll"

	for d.NextBlock(0) {
		var err error
		switch d.Val() {
		case "disable_redirects":
			b.DisableRedirects = true
		case "disable_gzips":
			b.DisableGzips = true
		case "disable_xmls":
			b.DisableXmls = true
		case "disable_random_server_header":
			b.DisableRandomServerHeader = true
		default:
			err = d.Errf("not a valid troll option")
		}
		if err != nil {
			return d.Errf("Error parsing %s: %s", d.Val(), err)
		}
	}

	return nil
}

func (b *Troll) Provision(ctx caddy.Context) (err error) {
	b.log = ctx.Logger(b)

	// parse env vars
	// replacer := caddy.NewReplacer()
	b.log.Info(
		"BOOT",
		zap.String("disable_redirects", strconv.FormatBool(b.DisableRedirects)),
		zap.String("disable_gzips", strconv.FormatBool(b.DisableGzips)),
		zap.String("disable_xmls", strconv.FormatBool(b.DisableXmls)),
		zap.String("disable_random_server_header", strconv.FormatBool(b.DisableRandomServerHeader)),
	)

	buff, err := base64.StdEncoding.DecodeString("")
	if err != nil {
		return
	}
	b.gzipBomb = buff

	buff, err = base64.StdEncoding.DecodeString("")
	if err != nil {
		return
	}
	b.billionLaughs = buff

	return nil
}

func (b *Troll) Validate() error {
	return nil
}
